DESCRIPTION:
Alkūnės g.8 rytiniame namo kieme styro gelžbetoninis strypas (galimai elektros stulpo liekana). Ar galėtų administruojanti įmonė iškelti ir išvežti šią atlieką? 

a) Neestetiškas vaizdas;
b) Tikėtina galimybė susižaloti jeigu nuvirstų;

Alkūnės g.8 rytiniame namo kieme styro gelžbetoninis strypas (galimai elektros stulpo liekana). Ar galėtų administruojanti įmonė iškelti ir išvežti šią atlieką? 

a) Neestetiškas vaizdas;
b) Tikėtina galimybė susižaloti jeigu nuvirstų;

Dėl anksčiau registruotos problemos E50-15690/21(3.2.55E-EM4) gautas atsakymas, kad &#34;dalis teritorijos panaudota gerinant infrastruktūrą. Likusi teritorijos dalis numatoma palikti be kietų dangų, atsėjant veją ir papildant ją medžiais bei krūmų grupėmis.&#34;
Taip pat atsakyta, kad &#34;šiuo metu projektuojami keli atskirieji želdynai kvartaluose tarp Žalgirio, Kalvarijų, Lvovo gatvėmis (skveras tarp Giedraičių ir Kintų gatvių; Giedraičių – Krokuvos g. skveras (Drakono pieva))&#34; - deja šie sklypai yra toli ir aplinkiniai namai tokie kaip &#34;Žalgirio 98,96,106A&#34; ir aplinkiniai visiškai neturi nei vienos minimalios žalios stotelės ar net suolelio Žalgirio gatvės atkarpoje. 
Todėl tai būtų puiki vieta pritaikyti šį mažą skverą stabtelėjimui, prisėdimui, net jei jis gana arti gatvių.

