2021 m. liepos 27 d. buvo kreiptasi dėl lietaus vandens padarytos žalos: &#34;Po lietaus vanduo teka Maironio gatve žemyn link Aušros gatvės, kadangi nėra šaligatvio bortelių, plaunamas įvažiavimas į sklypą, be to, smėlis kemša pralaidą esančią po Aušros gatve.&#34; 
Gautas atsakymas, kad įmonė remontuojanti Marijampolės m. gatves įpareigota suremontuoti suirusią dangą. 
Siunčiu nuotraukas po suirusios dangos suremontavimo. Buvo užpilta skalda, kuri toliau sėkmingai plaunama į upelį. Pralaida nesutvarkyta.

